import { Link,Outlet } from 'react-router-dom'
export default function Layout() {
    return (
        <>
        <header>
        <Link to='/' >Main</Link>
        <Link to='/search' >Search</Link>
        <Link to='/moreinfo' >Detail</Link>
        <Link to='/favorite' >Favorite</Link>
        </header>
            <Outlet />
        </>
    ) 
};
